import React from 'react';

function AboutMeItem(props) {
  return (
    <>
      <li className='aboutme__item'>
            <figure className='aboutme__item__pic-wrap' data-category={props.label}>
                <img
                    className='aboutme__item__img'
                    alt='About Me'
                    src={props.src}
                />
            </figure>
            <div classname='aboutme__item__info'>
                <h2 className='aboutme__item__text'>{props.title}</h2>
            </div>
            <div classname='aboutme__item__info'>
                <h3 className='aboutme__item__text'>{props.subtitle}</h3>
            </div>
            <div classname='aboutme__item__info'>
                <p className='aboutme__item__text'>{props.goal}</p>
            </div>

      </li>
    </>
  );
}

export default AboutMeItem;
